('2399','18','7921','villa Marga',Null,'Einfamilienhaus mit super Meerblick in Cala Blava','33715','Cala Blava ist eine sehr beliebte Wohnlage mit guter Infrastruktur und nur 15 Fahrminuten von Palma entfernt. Zu den Golfplätzen Maioris und Son Antem sind es nur wenige km. Das Haus steht auf einem  1.570m² großen Grundstück mit sehr schönem Meerblick. Die 310m² Wohnfläche verteilt sich auf 2 Wohnetagen mit Wohn-Esszimmer, Küche, Gäste WC, 5 Schlafzimmer und 4 Badezimmer. Eine Ölzentralheizung (Radiatoren) sorgt auch im Winter für Wohlbehagen. Die Garage bietet Platz für 2 Autos. Ein Pool mit überdachten und freien Terrassen sowie ein Grillplatz laden zum relaxen ein','33716','1600000','106','2015-11-11 13:11:33','106','2015-11-11 13:11:13',Null,'2513','74','1179',1,'1','0',Null,Null,Null,'33717',Null,'0','0','0',Null,'2015-11-11 13:16:11',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33718',Null,'33719',Null,'33720',Null,'33721','971 451 618   610 215 953','33722','0',0,'0');
